import React from 'react'
import Navbar from './components/Navbar/Navbar.jsx';
import Intro from './components/Intro/Intro.jsx'
import './App.css';

function App() {
  return (
    <div className="app">
      <div class="background-row">
        <img src="/assests/bc2.png" alt="bc2" id="mon"/>
        <img src="/assests/bc3.png" alt="bc3" />
        <img src="/assests/bcc.png" alt="bcc" />
        <img src="/assests/bcc2.png" alt="bcc2" />
      </div>
      <Navbar />
      <Intro />
    </div>
  );
}

export default App;
